        }
    }
    generatePDF = () => {
        var doc = new jsPDF();
        doc.text(20, 20, 'This is the first title.');
        doc.setProperties({
            title: 'Title',
            subject: 'This is the subject',
            author: 'James Hall',
            keywords: 'generated, javascript, web 2.0, ajax',
            creator: 'MEEE'
        });
        doc.addPage();
        doc.save('a4.pdf');
    }
    render() {
        return (
            <div>
                <iframe>
                    {this.generatePDF()}
                </iframe>
            </div>
        );
    }
}
